import React from 'react';

const headline = (props) => {
    return (
        <div>
            <h5>Headline:</h5>
            <textarea 
                className="form-control"
                type="text" 
                onChange={props.change} 
                value={props.value} 
                rows="2"
                name="headline"
            />
        </div>
    )
}

export default headline;
